('1dcbf3bc-2b5e-4ae8-be46-f5f61d9c3032', 'Cho thuê phòng trọ mới Đường Lương Thế Vinh, Phường Tân Thới Hòa, Quận Tân Phú (gần Đầm Sen)', '5', 'UAHN', 'Địa chỉ: 48/13 Đường Lương Thế Vinh, Phường Tân Thới Hòa, Quận Tân Phú, Hồ Chí Minh', 'be94a0cc-05a1-46e4-8d5e-5431e876fd65', 'CTMB', 'TU2N', '3U-D', 'MUID', '[\"Giá Phòng từ 1800k đến xem đảm bảo ưng ý, cam kết hình đúng với thực tế\",\"Phòng mới sửa chữa cuối tháng 7/2022, địa chỉ 48/13 Lương Thế Vinh Phường Tân Thế Hòa, Q.Tân Phú, nhà hẽm xe hơi lộ giới 5m .\",\"Diện Tích 12m + 8m ( gác lững )\",\"Phòng có tolet riêng, cửa sổ, ban công, có phòng dưới trệt\",\"Cho nấu ăn trong phòng, Ở được 2-4 người, bạn bè lại chơi thoãi mái.\",\"Miễn phí internet, wifi, truyền hình cáp, Camera 15 cái ( an ninh quan sát không góc chết )\",\"Để xe trong sân nhà thoáng mát có bảo vệ coi 24/24\",\"Vị trí gần Đầm Sen, thuận tiện qua lại Q.6, Q.11, Tân Phú\",\"Điện 3,5k/ 1 ký, nước 70k / 1 người, xe 100k/ 1 chiếc .\",\"Xe để sân sau nhà có người quản lý và trông coi ( không chung chủ ) giúp bạn có cảm giác an toàn, thoải mái\",\"LH : 0938864405 ( Cường )\",\"LH zalo : 0938864405 ( Cường Phạm )\"]', '0b2894c8-42ef-423c-8a16-94ebb26264fe', '9d164d1c-3abd-46bf-98ae-417bd3bdc7be', 'fe94c941-39ee-4bd0-b3b7-ee82b23c7eb3', 1.8, 20, '2023-05-15 18:03:17', '2023-05-15 18:03:17'),
