('46601673-8ace-4447-8f61-b3ef56b8eed8', 'Phòng trọ sleepbox ngay chợ Gò Vấp Lê Quang Định giá 1,8tr 0792686899', '5', 'UUHO', 'Địa chỉ: Đường Lê Quang Định, Phường 1, Quận Gò Vấp, Hồ Chí Minh', '79830e09-8881-4449-b34d-f5dd682f75d9', 'CTCH', 'TU2N', '0N9E', 'MUID', '[\"Khai trương tòa nhà sleepbox ngay tại chợ Gò Vấp, gần trường DH Công Nghiệp HCM\",\"Với vị trí này,  Chỉ cần một vài bước chân, bạn có thể đến trường học và tránh được những cảnh tắc đường, mất thời gian trong giờ cao điểm.\",\"SLEEPBOX Gò Vấp cung cấp các phòng trọ được thiết kế thông minh với diện tích rộng rãi, đầy đủ tiện nghi và an toàn.\",\"Cửa mỗi Sleepbox được thiết kế khoá bằng THẺ TỪ tuyệt đối an ninh.\",\"Mỗi phòng được trang bị tủ quần áo, tủ lạnh riêng, máy lạnh, giường ngủ tiện nghi và nhà vệ sinh sạch sẽ với nước nóng lạnh.\",\"Được trang bị hệ thống bảo mật cao với Face ID và camera hồng ngoại cổng vào để đảm bảo an toàn cho khách hàng.\",\"Không chỉ có các tiện nghi trong phòng, SLEEPBOX Gò Vấp còn cung cấp nhiều dịch vụ miễn phí như máy giặt, máy sấy, sân phơi đồ rộng rãi, camera an ninh 24/24 và dịch vụ dọn vệ sinh hàng ngày để giúp khách hàng có một cuộc sống thoải mái và tiện nghi nhất.\",\"Điều đặc biệt ở SLEEPBOX Gò Vấp chính là khách hàng sẽ không phải lo lắng về chi phí, bởi vì tụi mình cam kết không phát sinh bất kì chi phí nào cho khách hàng.\",\"Hiện nay, tụi mình đã có hơn 10 chi nhánh trên địa bàn TP.HCM để đáp ứng nhu cầu của khách hàng.\",\"Nếu bạn đang tìm kiếm một chỗ ở gần trường học với giá cả hợp lý, tiện nghi và an toàn, hãy đến với SLEEPBOX Gò Vấp và trải nghiệm sự thoải mái tuyệt vời.\",\"Liên hệ với mình qua số Zalo: Thanh Hiền 0792686899\"]', '0ad01368-c857-4d2b-874b-a9a232530408', 'f484f2c2-83cf-42f8-b00f-d37e3df4485c', '8a07e142-8565-4ce9-a3f5-43c16e218ace', 1.8, 242, '2023-05-15 18:03:17', '2023-05-15 18:03:17'),
