('c6737c4a-c43e-40c2-8570-97de44a9f5a8', 'Cho thuê trọ phòng riêng Chung cư Era Town Đức Khải. Sử dụng tủ lạnh, máy giặt free.', '5', 'UOPN', 'Địa chỉ: Nguyễn Lương Bằng, Phường Phú Mỹ, Quận 7, Hồ Chí Minh', '2ec2e670-5497-47c2-b0a4-95ee87b13a91', 'CTMB', 'TU2N', '0N2E', 'MUID', '[\"Phù hợp cho bạn nào đang tìm phòng riêng nhỏ gọn tối về nghĩ ngơi, yên tĩnh, môi truờng khu dân cư an ninh, công viên đông vui- mát mẽ, sạch sẽ. đời sống dân trí cao. Có tủ lạnh, máy giặt sử dụng free. Tolet chung cạnh phòng ít người dùng phù hợp nam hoặc nữ tuỳ từng căn hộ. Thẻ từ thang máy và chìa khoá phòng riêng. Giờ giấc tự do.Trạm xe buyt đi Q1 ngay tại chung cư .\",\"Chung cư mát mẽ ,bờ sông thoáng mát, bảo vệ -cửa hàng tiện lợi crie K , Gs 25 hoạt động 24/24. Xe gửi dưới hầm rộng rãi, thoải mái, Buổi chiều có thể đi bộ tập thể dục giạo quanh khuân viên tiện ích đầy đủ chợ, truờng học, công an , siêu thị ngay tại chung cư. Wifi 5G mạnh vivu.\",\"Ở trọ chung cư thoáng mát , tiện ích đầy đủ, công viên cây xanh rộng rãi , thoải mái và an ninh khác biệt so với ở căn hộ dịch vụ hay phòng trọ kiểu truyền thống.\",\"Dạng phòng riêng 1 nguời ở tolet chung ngoài phòng giá 1tr7-2tr diện tích 7-10m2\",\"Chú ý : Không cho nuôi thú cưng.\",\"Khách thuê cùng đa số là nvvp và người đi làm lịch sự, sạch sẽ, có thuê thêm nguời lau giọn vệ sinh hàng tuần. Gần Hồ Bán Nguyệt , TTTM Resscent Mall và khu Phú Mỹ Hưng, Nằm trên trục đường mặt tiền chính đường lớn 8 làn xe.\",\"Chủ nhà dễ tính, nhiệt tình , thoải mái,\",\"Cảm ơn mọi người đã xem bài.!\"]', '725cd4cb-bdd3-4bcf-a74a-4bf8c1a538c2', 'f89deb15-d320-44ba-b2dd-4edb1704e18d', '1fbc3049-738e-4443-9e27-f23d1810798e', 1.7, 8, '2023-05-15 18:03:17', '2023-05-15 18:03:17'),
