('f966341f-1172-40ba-88de-dac896966f74', 'PHÒNG CHO THUÊ NGAY LOTTE Q.7 - CHỈ TỪ 3.4TR - BAO GIÁ TỐT - Alo 0988.373.731', '4', 'UOPN', 'Địa chỉ: 80 Đường số 3, Phường Tân Kiểng, Quận 7, Hồ Chí Minh', '13fb49ce-7d00-4cbf-866e-9e82999a52df', 'CTMB', 'TU5N', '3U-D', 'MUID', '[\"Các tiện ích chỉ có ở tại Fullhouse ngay Lotte Q.7. 100% dân trí cao, Sạch đẹp - Văn minh - Nhân ái\",\"Ngay Lotte Q.7 (đi bộ 2 phút đến đại siêu thị)! Alo ngay: 0988.373.731 Ms Hòa.\",\"Căn phòng dành cho bạn thì đầy đủ tiện nghi, tiết kiệm điện và bảo vệ môi trường với hệ đèn LED - Nước nóng năng lượng mặt trời - Máy lạnh Inverter - WC và bếp riêng tiện nghi và tự do.\",\"Tòa nhà luôn được vệ sinh sạch sẽ để bảo vệ sức khỏa toàn bộ dân cư.Tòa nhà xài hệ thống NLMT và máy lạnh Inverter giúp tiết kiệm điện.\",\"Tòa nhà 8 tầng mới xây sạch,đẹp,văn minh thoáng mát, an ninh. Liền kề 5 phút đến Q1, Q4, Q5, Q8, Crescent Mall, SC Vivo, vị trí vàng đẹp Q. 7...Thuê chỗ ở bây giờ cần phải đảm bảo an toàn PCCC tuyệt đối. Tòa nhà căn hộ cho thuê cao cấp của chúng tôi có thẩm duyệt PCCC và đã nghiệm thu PCCC kèm theo bảo hiểm đảm bảo an toàn cho toàn bộ cư dân sống và làm việc tại đây, có an cư, an toàn mới lạc nghiệp.\",\"Giá từ 3.4 - 5 triệu/tháng, bao giá tốt khắp khu vực.\",\"Alo ngay: 0988.373.731 Ms Hòa.\",\"Đảm bảo 100% sự hài lòng.\",\"80 Đường Số 03, P. Tân Kiểng, Q. 7 - LH: 0988.373.731 Ms Hòa.\"]', '23ae9fa7-efdc-4c3a-a8a9-da56b490e349', '2a54c5f8-f129-4502-81b9-191c29b0bdb5', 'c5dfcb59-e24b-4cdd-b22a-058af60e3235', 3.4, 25, '2023-05-15 18:03:17', '2023-05-15 18:03:17');
